import React from 'react';
import Card from './Card';
import Slider from 'react-slick';

function Carusele({ text }) {
	var settings = {
		dots: true,
		infinite: true,
		speed: 500,
		slidesToShow: 4,
		slidesToScroll: 1,
	};
	return (
		<main className="carusele">
			<div>
				<div
					style={{
						fontSize: '2rem',
					}}
				>
					{text}
				</div>
				<div></div>
			</div>
			<div
				style={{
					display: 'flex',
					justifyContent: 'center',
				}}
			>
				<Slider {...settings}>
					<div>abcd</div>
				</Slider>
			</div>
		</main>
	);
}

export default Carusele;
